import React from "react";
import { Container, Row } from "react-bootstrap";

import Card from '../components/Card'

import Fisico1 from '../img/fisico1.png';
import Digital1 from '../img/digital1.png';

export default Index => {
    return (
        <div>
            <Row style={{ display: 'flex', justifyContent: 'space-between', padding: '20px' }}>
                <Container>
                    <Card Titulo='Convite de casamento' Texto='R$ 3,00 Un.' Img={Fisico1} />
                    <Card Titulo='Convite de casamento' Texto='R$ 3,00 Un.' Img={Fisico1} />
                    <Card Titulo='Convite digital' Texto='R$ 25,00' Img={Digital1} />
                </Container>
            </Row>
        </div>
    );
}
